import Link from 'next/link';
import background from '/images/background.png'

const LandingPage = () => (
    <div styles={{ backgroundImage:`url(${background})`}}>
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
        <style jsx>{`
            a: hover {
                opacity: 0.6;
            }
        `}</style>
    </div>
);

export default LandingPage;
